var suggestions=document.getElementById('suggestions'),search=document.getElementById('search');search!==null&&document.addEventListener('keydown',inputFocus);function inputFocus(a){a.ctrlKey&&a.key==='/'&&(a.preventDefault(),search.focus()),a.key==='Escape'&&(search.blur(),suggestions.classList.add('d-none'))}document.addEventListener('click',function(a){var b=suggestions.contains(a.target);b||suggestions.classList.add('d-none')}),document.addEventListener('keydown',suggestionFocus);function suggestionFocus(b){const d=suggestions.querySelectorAll('a'),e=[...d],a=e.indexOf(document.activeElement),f=suggestions.classList.contains('d-none');let c=0;b.keyCode===38&&!f?(b.preventDefault(),c=a>0?a-1:0,d[c].focus()):b.keyCode===40&&!f&&(b.preventDefault(),c=a+1<e.length?a+1:a,d[c].focus())}(function(){var a=new FlexSearch.Document({tokenize:"forward",cache:100,document:{id:'id',store:["href","title","description"],index:["title","description","content"]}});a.add({id:0,href:"https://doks.netlify.app/docs/provisioning/provision/",title:"Provisioning New Lab VM",description:"How to provision a new virtual machine in Innovations Lab vSphere",content:'\u003ch2 id="get-started"\u003eGet started\u003c/h2\u003e\n\u003cp\u003eThere are two main ways to provision a new server:\u003c/p\u003e\n\u003ch3 id="net-boot-from-pxe"\u003eNet Boot from PXE\u003c/h3\u003e\n\u003cdiv class="alert alert-warning d-flex" role="alert"\u003e\n  \u003cdiv class="flex-shrink-1 alert-icon"\u003eðŸ‘‰ \u003c/div\u003e\n  \n    \u003cdiv class="w-100"\u003eThis is the recommended method. It will install Ubuntu 21.10 Impish Indri. \u003c/div\u003e\n  \n\u003c/div\u003e\n\n\u003cp\u003eThis will guide you step-by-step through \u003ca href="/docs/provisioning/net-booting/"\u003eNet Booting. â†’\u003c/a\u003e\u003c/p\u003e\n\u003ch3 id="boot-from-iso-file"\u003eBoot from ISO file\u003c/h3\u003e\n\u003cdiv class="alert alert-warning d-flex" role="alert"\u003e\n  \u003cdiv class="flex-shrink-1 alert-icon"\u003eðŸ‘‰ \u003c/div\u003e\n  \n    \u003cdiv class="w-100"\u003eThis method will NOT configure your server with LDAP/AD authentication. \u003c/div\u003e\n  \n\u003c/div\u003e\n\n\u003cp\u003eThis will guide you through provisioning via \u003ca href="/docs/provisioning/file-iso/"\u003eFile ISO. â†’\u003c/a\u003e\u003c/p\u003e\n'}).add({id:1,href:"https://doks.netlify.app/docs/provisioning/net-booting/",title:"Net Booting from PXE",description:"How to provision a new virtual machine in Innovations Lab vSphere",content:'\u003ch3 id="setup"\u003eSetup\u003c/h3\u003e\n\u003cp\u003eFirst, ensure you have a VPN connection to the O\u0026rsquo;Fallon Lab, have valid Innovations Lab credentials, and can log into \u003ca href="https://adlbvc01.agiledefense.lab/ui/"\u003eInnovations Lab vSphere\u003c/a\u003e\u003c/p\u003e\n\u003ch3 id="provision"\u003eProvision\u003c/h3\u003e\n\u003col\u003e\n\u003cli\u003eRight click on \u003cstrong\u003eDellCluster\u003c/strong\u003e and select \u003cstrong\u003eNew Virtual Machine\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/netboot_1.png" alt="img"\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003col start="2"\u003e\n\u003cli\u003eSelect \u003cstrong\u003eCreate a new virtual machine\u003c/strong\u003e if it isn\u0026rsquo;t selected already and click \u003cstrong\u003eNext\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/netboot_2.png" alt="img"\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003col start="3"\u003e\n\u003cli\u003eGive your VM a name, then click \u003cstrong\u003eNext\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class="alert alert-warning d-flex" role="alert"\u003e\n  \u003cdiv class="flex-shrink-1 alert-icon"\u003eðŸ‘‰ \u003c/div\u003e\n  \n    \u003cdiv class="w-100"\u003e\u003cb\u003eNOTE\u003c/b\u003e: The name given will end up being the hostname of the vm, as well as the DNS routing name. \u003cbr\u003e\u003cbr\u003e (e.g. if you name it \u003cb\u003eTest_VM\u003c/b\u003e, the hostname will be \u003cb\u003eTestVM\u003c/b\u003e because underscores get removed and the DNS endpoint will be \u003cb\u003etest_vm.agiledefense.lab\u003c/b\u003e). \u003c/div\u003e\n  \n\u003c/div\u003e\n\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/netboot_3.png" alt="img"\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003col start="4"\u003e\n\u003cli\u003eSelect a Resource Pool, if desired. Otherwise, select the parent \u003cstrong\u003eDellCluster\u003c/strong\u003e. We\u0026rsquo;re going to select \u003cstrong\u003eSoftwareDev\u003c/strong\u003e in this example. Click \u003cstrong\u003eNext\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/netboot_4.png" alt="img"\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003col start="5"\u003e\n\u003cli\u003eSelect a storage solution for your vm and hit \u003cstrong\u003eNext\u003c/strong\u003e. I\u0026rsquo;m selecting \u003ccode\u003evsanDatastore\u003c/code\u003e because it has the largest capacity at the moment.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/netboot_5.png" width="725" /\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003col start="6"\u003e\n\u003cli\u003eSelect \u003ccode\u003eESXI 6.7 Update 2 and later\u003c/code\u003e to ensure you have the latest compatibility hardware and performance features. Then click \u003cstrong\u003eNext\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/netboot_6.png" width="725" /\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003col start="7"\u003e\n\u003cli\u003eSelect \u003ccode\u003eLinux\u003c/code\u003e for \u003cstrong\u003eGuest OS Family\u003c/strong\u003e and \u003ccode\u003eUbuntu Linux (64-bit)\u003c/code\u003e for \u003cstrong\u003eGuest OS Version\u003c/strong\u003e and hit \u003cstrong\u003eNext\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/netboot_7.png" alt="img"\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003col start="8"\u003e\n\u003cli\u003eCustomize your virtual hardware settings.\n\u003col\u003e\n\u003cli\u003eSelect how many CPUs (\u003ccode\u003eRecommend a minimum of 2\u003c/code\u003e)\u003c/li\u003e\n\u003cli\u003eSelect how much Memory (\u003ccode\u003eRecommend a minimum of 2GB\u003c/code\u003e)\u003c/li\u003e\n\u003cli\u003eSelect Hard Disk size (\u003ccode\u003eRecommend a minimum of 50GB\u003c/code\u003e)\u003c/li\u003e\n\u003cli\u003eSelect \u003ccode\u003eBrowse\u003c/code\u003e in \u003cstrong\u003eNew Network\u003c/strong\u003e dropdown menu and choose the \u003ccode\u003eVM Lab\u003c/code\u003e network to ensure proper connectivity to the web.\u003c/li\u003e\n\u003cli\u003eCustomize the rest of the hardware to your desired specifications\u003c/li\u003e\n\u003c/ol\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/netboot_8.png" width="725" /\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003col start="9"\u003e\n\u003cli\u003eSelect \u003cstrong\u003eVM Options\u003c/strong\u003e while still in the \u003cstrong\u003eCustomize hardware\u003c/strong\u003e menu and under \u003cstrong\u003eBoot Options\u003c/strong\u003e select \u003ccode\u003eEFI\u003c/code\u003e for \u003cstrong\u003eFirmware\u003c/strong\u003e, otherwise it will not boot properly.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/netboot_9.png" width="725" /\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003col start="10"\u003e\n\u003cli\u003eNow scroll down and expend the \u003cstrong\u003eAdvanced\u003c/strong\u003e tab of the \u003cstrong\u003eVM Options\u003c/strong\u003e menu. The click \u003cstrong\u003eEDIT CONFIGURATION\u003c/strong\u003e under the \u003cstrong\u003eConfiguration Parameters\u003c/strong\u003e section. Then click \u003cstrong\u003eADD CONFIGURATION PARAMS\u003c/strong\u003e. Under \u003cstrong\u003eName\u003c/strong\u003e, type or copy/paste \u003ccode\u003eguestinfo.hostname\u003c/code\u003e. Under the \u003cstrong\u003eValue\u003c/strong\u003e type the name of your vm. In this case, it was \u003ccode\u003eTest_VM\u003c/code\u003e. Click \u003cstrong\u003eOK\u003c/strong\u003e and lastly, click \u003cstrong\u003eNext\u003c/strong\u003e\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/netboot_10.png" width="725" /\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003col start="11"\u003e\n\u003cli\u003eInspect your settings to ensure nothing was missed. When you\u0026rsquo;re ready, click \u003cstrong\u003eFinish\u003c/strong\u003e. Then, navigate to your VM in vSphere and click the green play (\u003ccode\u003estart\u003c/code\u003e) button to initiate cloud init.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/netboot_11.png" width="725" /\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003col start="12"\u003e\n\u003cli\u003eAfter 15-20 minutes, and several reboots, you should be able to ssh to your new vm utilizing your lab username and password.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/netboot_12.png" width="725" /\u003e\u003c/p\u003e\n\u003ch3 id="congratulations"\u003eCongratulations!!\u003c/h3\u003e\n\u003cp\u003eYou\u0026rsquo;ve successfully net booted your first Linux VM in the Innovations Lab. For any issues that may arise during any of these steps, please see the \u003ca href="/docs/help/faq/"\u003eFAQ\u003c/a\u003e.\u003c/p\u003e\n'}).add({id:2,href:"https://doks.netlify.app/docs/provisioning/file-iso/",title:"Booting from File ISO",description:"How to provision a new virtual machine in Innovations Lab vSphere",content:'\u003ch3 id="setup"\u003eSetup\u003c/h3\u003e\n\u003cp\u003eFirst, ensure you have a VPN connection to the O\u0026rsquo;Fallon Lab, have valid Innovations Lab credentials, and can log into \u003ca href="https://adlbvc01.agiledefense.lab/ui/"\u003eInnovations Lab vSphere\u003c/a\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003ch3 id="provision"\u003eProvision\u003c/h3\u003e\n\u003col\u003e\n\u003cli\u003eRight click on \u003cstrong\u003eDellCluster\u003c/strong\u003e and select \u003cstrong\u003eNew Virtual Machine\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/netboot_1.png" alt="img"\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003col start="2"\u003e\n\u003cli\u003eSelect \u003cstrong\u003eCreate a new virtual machine\u003c/strong\u003e if it isn\u0026rsquo;t selected already and click \u003cstrong\u003eNext\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/netboot_2.png" alt="img"\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003col start="3"\u003e\n\u003cli\u003eGive your VM a name, then click \u003cstrong\u003eNext\u003c/strong\u003e. We\u0026rsquo;ll use \u003ccode\u003eTest_VM\u003c/code\u003e for this example.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/netboot_3.png" alt="img"\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003col start="4"\u003e\n\u003cli\u003eSelect a Resource Pool, if desired. Otherwise, select the parent \u003cstrong\u003eDellCluster\u003c/strong\u003e. We\u0026rsquo;re going to select \u003cstrong\u003eSoftwareDev\u003c/strong\u003e in this example. Click \u003cstrong\u003eNext\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/netboot_4.png" alt="img"\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003col start="5"\u003e\n\u003cli\u003eSelect a storage solution for your vm and hit \u003cstrong\u003eNext\u003c/strong\u003e. I\u0026rsquo;m selecting \u003ccode\u003evsanDatastore\u003c/code\u003e because it has the largest capacity at the moment.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/netboot_5.png" width="725" /\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003col start="6"\u003e\n\u003cli\u003eSelect \u003ccode\u003eESXI 6.7 Update 2 and later\u003c/code\u003e to ensure you have the latest compatibility hardware and performance features. Then click \u003cstrong\u003eNext\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/netboot_6.png" width="725" /\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003col start="7"\u003e\n\u003cli\u003eSelect the \u003cstrong\u003eGuest OS Family\u003c/strong\u003e for your family of operating system based on your ISO file. Then select the appropriate \u003cstrong\u003eGuest OS Version\u003c/strong\u003e and hit \u003cstrong\u003eNext\u003c/strong\u003e. We\u0026rsquo;ll use \u003cstrong\u003eWindows\u003c/strong\u003e for the family and \u003cstrong\u003eMicrosoft Windows Server 2012 (64-bit)\u003c/strong\u003e for the version.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/iso_1.png" alt="img"\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003col start="8"\u003e\n\u003cli\u003eCustomize your virtual hardware settings.\n\u003col\u003e\n\u003cli\u003eSelect how many CPUs needed for your OS and operations\u003c/li\u003e\n\u003cli\u003eSelect how much Memory for your OS and operations\u003c/li\u003e\n\u003cli\u003eSelect Hard Disk size for your OS and operations\u003c/li\u003e\n\u003cli\u003eSelect \u003ccode\u003eBrowse\u003c/code\u003e in \u003cstrong\u003eNew Network\u003c/strong\u003e dropdown menu and choose the \u003ccode\u003eVM Lab\u003c/code\u003e network to ensure proper connectivity to the web.\u003c/li\u003e\n\u003cli\u003eUnder \u003cstrong\u003eNew CD/DVD Drive\u003c/strong\u003e select \u003ccode\u003eDatastore ISO File\u003c/code\u003e. Then navigate to where your ISO file is stored in the lab and select it. Then click \u003cstrong\u003eOK\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003eEnsure you click \u003ccode\u003eConnect at Power On\u003c/code\u003e for the CD/DVD drive.\u003c/li\u003e\n\u003c/ol\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/iso_2.png" width="725" /\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003col start="9"\u003e\n\u003cli\u003eFinish customizing your hardware/firmware as needed. Then click \u003cstrong\u003eNext\u003c/strong\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/iso_3.png" width="725" /\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003col start="10"\u003e\n\u003cli\u003eInspect your settings to ensure nothing was missed. When you\u0026rsquo;re ready, click \u003cstrong\u003eFinish\u003c/strong\u003e. Then, navigate to your VM in vSphere and click the green play (\u003ccode\u003estart\u003c/code\u003e) button to boot. Then click \u003ccode\u003eLaunch Web Console\u003c/code\u003e to open the console.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/iso_4.png" width="725" /\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003col start="11"\u003e\n\u003cli\u003eWalk through the process of installing your operating system. The steps will vary depending on OS family and version.\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch3 id="congratulations"\u003eCongratulations!!\u003c/h3\u003e\n\u003cp\u003eYou\u0026rsquo;ve successfully created a custom VM with your own OS! Log in with the credentials you set up during the OS installation process, and you\u0026rsquo;re ready to go.\u003c/p\u003e\n\u003cdiv class="alert alert-warning d-flex" role="alert"\u003e\n  \u003cdiv class="flex-shrink-1 alert-icon"\u003eðŸ‘‰ \u003c/div\u003e\n  \n    \u003cdiv class="w-100"\u003e\u003cb\u003eNOTE\u003c/b\u003e: This will not register the VM with DNS, nor will it setup LDAP authentication with the Active Directory. You will have to do that manually for your VM, if you so desire. \u003c/div\u003e\n  \n\u003c/div\u003e\n\n'}).add({id:3,href:"https://doks.netlify.app/docs/pipelines/",title:"Working with GoCD",description:"GoCd Pipelines",content:'\u003ch2 id="create-a-pipeline"\u003eCreate a pipeline\u003c/h2\u003e\n\u003cp\u003eTo create a pipeline in GoCD, see \u003ca href="/docs/pipelines/create/"\u003eCreate a GoCd Pipeline â†’\u003c/a\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003ch2 id="pipeline-configurations"\u003ePipeline Configurations\u003c/h2\u003e\n\u003cp\u003eHave questions about pipeline, stage, and job configurations and their values?, go to \u003ca href="/docs/pipelines/pipeline-config/"\u003eGoCD Configurations â†’\u003c/a\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003ch2 id="create-a-default-go-agent"\u003eCreate a Default Go-Agent\u003c/h2\u003e\n\u003cp\u003eCreate a standard go-agent, go visit \u003ca href="/docs/pipelines/agent/"\u003eConfigure a GoCD Agent â†’\u003c/a\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003ch2 id="just-go-agent-on-linux"\u003eJust Go-Agent on Linux\u003c/h2\u003e\n\u003cp\u003eHave a Linux box and want go-agent installed?, see \u003ca href="/docs/pipelines/agent/#go-agent-only"\u003eGo-Agent ONLY â†’\u003c/a\u003e\u003c/p\u003e\n\u003cbr/\u003e'}).add({id:4,href:"https://doks.netlify.app/docs/pipelines/create/",title:"Create a GoCD Pipeline",description:"How to create a basic pipeline in GoCD",content:'\u003ch3 id="setup"\u003eSetup\u003c/h3\u003e\n\u003cp\u003eFirst, ensure you have a VPN connection to the O\u0026rsquo;Fallon Lab, have valid Innovations Lab credentials, and can log into \u003ca href="http://gocd.agiledefense.lab"\u003eGoCD\u003c/a\u003e\u003c/p\u003e\n\u003ch3 id="create-pipeline"\u003eCreate Pipeline\u003c/h3\u003e\n\u003cp\u003eOnce logged in, click \u003cstrong\u003eNew Pipeline\u003c/strong\u003e in the upper right-hand corner and select \u003ccode\u003eUse Pipeline Wizard\u003c/code\u003e\u003c/p\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/pipeline_1.png" alt="img"\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003ch3 id="part-1-material"\u003ePart 1: Material\u003c/h3\u003e\n\u003cp\u003eFor material type, select \u003ccode\u003eGit\u003c/code\u003e if you\u0026rsquo;re pulling from GitHub (\u003cem\u003ecommon\u003c/em\u003e), \u003ccode\u003eAnother Pipeline\u003c/code\u003e if it pulls packages or artifacts from another GoCD pipeline, otherwise select the appropriate Material type.\u003c/p\u003e\n\u003cp\u003eThen add the URL associated with the repository and click \u003ccode\u003eTest Connection\u003c/code\u003e to make sure GoCD can see it.\u003c/p\u003e\n\u003cdiv class="alert alert-warning d-flex" role="alert"\u003e\n  \u003cdiv class="flex-shrink-1 alert-icon"\u003eðŸ‘‰ \u003c/div\u003e\n  \n    \u003cdiv class="w-100"\u003e\u003cb\u003eNOTE\u003c/b\u003e: If your default branch is named something other that \u003cb\u003emaster\u003c/b\u003e, you need to enter the \u003cb\u003eRepository Branch\u003c/b\u003e name under \u003cb\u003eAdvanced Settings\u003c/b\u003e \u003c/div\u003e\n  \n\u003c/div\u003e\n\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/pipeline_2.png" width="725" /\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003ch3 id="part-2-pipeline-name"\u003ePart 2: Pipeline Name\u003c/h3\u003e\n\u003cp\u003eEnter a name for you pipeline.\u003c/p\u003e\n\u003cp\u003eUnder \u003cstrong\u003eAdvanced Settings\u003c/strong\u003e, select the appropriate Pipeline Group (default is \u003ccode\u003eCPaaS\u003c/code\u003e). Here you can also enter parameters that will be available for every stage in a \u003ccode\u003eKey: Value\u003c/code\u003e store. It could be package names, directories, etc.\u003c/p\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/pipeline_3.png" width="725" /\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003ch3 id="part-3-stage-details"\u003ePart 3: Stage Details\u003c/h3\u003e\n\u003cp\u003eEnter a name for your first Stage. This is normally to run builds or tests, depending on your package and what you need. If you do not want this first stage to start automatically after upstream changes, uncheck \u003ccode\u003eAutomatically run this stage on upstream changes\u003c/code\u003e under \u003cstrong\u003eAdvanced Settings\u003c/strong\u003e\u003c/p\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/pipeline_4.png" width="725" /\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003ch3 id="part-4-job-and-tasks"\u003ePart 4: Job and Tasks\u003c/h3\u003e\n\u003cp\u003eEnter a name for the Job. A job is a series of tasks that execute in order.\u003c/p\u003e\n\u003cp\u003eYou can enter multiple commands, but it does not run in a real shell environment, so there are caveats.\u003c/p\u003e\n\u003cp\u003eIn the \u003cstrong\u003eAdvanced Settings\u003c/strong\u003e menu, you can add environment variables and secure environment variables that are not visible, even on the GoCD site.\u003c/p\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/pipeline_5.png" width="725" /\u003e\u003c/p\u003e\n\u003cp\u003eAfter you\u0026rsquo;ve configured your pipeline, you can either click \u003ca href="/docs/pipelines/pipeline-config/"\u003eSave + Edit Full Config â†’\u003c/a\u003e or \u003ca href="/docs/pipelines/create/#congratulations"\u003eSave + Run this Pipeline â†’\u003c/a\u003e\u003c/p\u003e\n\u003ch3 id="congratulations"\u003eCongratulations!\u003c/h3\u003e\n\u003cp\u003eYou have successfully configured and initiated your GoCD pipeline!\u003c/p\u003e\n'}).add({id:5,href:"https://doks.netlify.app/docs/pipelines/pipeline-config/",title:"GoCD Configurations",description:"All available configurations for a pipeline, it's stages, and their jobs",content:'\u003ch2 id="pipeline-configuration"\u003ePipeline Configuration\u003c/h2\u003e\n\u003ch3 id="general"\u003eGeneral\u003c/h3\u003e\n\u003cp\u003e\u003cstrong\u003eBasic Settings\u003c/strong\u003e\u003c/p\u003e\n\u003ctable\u003e\n\u003cthead\u003e\n\u003ctr\u003e\n\u003cth\u003e\u003c/th\u003e\n\u003cth\u003e\u003c/th\u003e\n\u003c/tr\u003e\n\u003c/thead\u003e\n\u003ctbody\u003e\n\u003ctr\u003e\n\u003ctd\u003eLabel Template\u003c/td\u003e\n\u003ctd\u003eDefaults to \u003ccode\u003e${COUNT}\u003c/code\u003e which will uptick the run count each time the pipeline is run. For more information \u003ca href="https://docs.gocd.org/21.2.0/configuration/pipeline_labeling.html"\u003esee this\u003c/a\u003e.\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eAutomatic pipeline scheduling\u003c/td\u003e\n\u003ctd\u003eUncheck this box only if you want the pipeline to be manually or API started.\u003c/td\u003e\n\u003c/tr\u003e\n\u003c/tbody\u003e\n\u003c/table\u003e\n\u003cp\u003e\u003cstrong\u003eTimer Settings\u003c/strong\u003e\u003c/p\u003e\n\u003ctable\u003e\n\u003cthead\u003e\n\u003ctr\u003e\n\u003cth\u003e\u003c/th\u003e\n\u003cth\u003e\u003c/th\u003e\n\u003c/tr\u003e\n\u003c/thead\u003e\n\u003ctbody\u003e\n\u003ctr\u003e\n\u003ctd\u003eCron Timer Specification\u003c/td\u003e\n\u003ctd\u003eUses Cron-like syntax to schedule pipeline runs on specific intervals. For more information \u003ca href="https://docs.gocd.org/21.2.0/configuration/admin_timer.html"\u003esee this\u003c/a\u003e.\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eRun only on new material\u003c/td\u003e\n\u003ctd\u003eOnly available if Automatic Pipeline scheduling is off. This will ensure that timed or API based pipeline runs only run with new material.\u003c/td\u003e\n\u003c/tr\u003e\n\u003c/tbody\u003e\n\u003c/table\u003e\n\u003cp\u003e\u003cstrong\u003ePipeline Locking Behavior\u003c/strong\u003e\u003c/p\u003e\n\u003ctable\u003e\n\u003cthead\u003e\n\u003ctr\u003e\n\u003cth\u003e\u003c/th\u003e\n\u003cth\u003e\u003c/th\u003e\n\u003c/tr\u003e\n\u003c/thead\u003e\n\u003ctbody\u003e\n\u003ctr\u003e\n\u003ctd\u003eRun multiple instances\u003c/td\u003e\n\u003ctd\u003eWill allow multiple runs of the pipeline (\u003ccode\u003edefault\u003c/code\u003e)\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eRun single instance of the pipeline and lock on failure\u003c/td\u003e\n\u003ctd\u003eWill only allow a single instance of the pipeline to be run at one time. Will lock if pipeline fails.\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eRun single instance of pipeline at a time\u003c/td\u003e\n\u003ctd\u003eWill only allow a single instance of the pipeline to be run at one time. Will \u003cstrong\u003enot\u003c/strong\u003e lock if pipeline fails.\u003c/td\u003e\n\u003c/tr\u003e\n\u003c/tbody\u003e\n\u003c/table\u003e\n\u003ch3 id="project-management"\u003eProject Management\u003c/h3\u003e\n\u003cp\u003e\u003cstrong\u003eTracking Tool Integration\u003c/strong\u003e\u003c/p\u003e\n\u003ctable\u003e\n\u003cthead\u003e\n\u003ctr\u003e\n\u003cth\u003e\u003c/th\u003e\n\u003cth\u003e\u003c/th\u003e\n\u003c/tr\u003e\n\u003c/thead\u003e\n\u003ctbody\u003e\n\u003ctr\u003e\n\u003ctd\u003ePattern\u003c/td\u003e\n\u003ctd\u003eA regular expression to identify card or bug numbers from your checkin comments. For more information, \u003ca href="https://docs.gocd.org/21.2.0/integration"\u003esee this\u003c/a\u003e.\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eURI\u003c/td\u003e\n\u003ctd\u003eThe URI to your tracking tool. This must contain the string ${ID} which will be replaced with the number identified using the pattern. For more information, \u003ca href="https://docs.gocd.org/21.2.0/integration"\u003esee this\u003c/a\u003e.\u003c/td\u003e\n\u003c/tr\u003e\n\u003c/tbody\u003e\n\u003c/table\u003e\n\u003ch3 id="materials"\u003eMaterials\u003c/h3\u003e\n\u003cp\u003eAdd or delete materials from the pipeline\u003c/p\u003e\n\u003ch3 id="stages"\u003eStages\u003c/h3\u003e\n\u003cp\u003eAdd or delete stages from the pipeline.\u003c/p\u003e\n\u003cp\u003eYou can also re-arrange the order by dragging and dropping the stage in the table by the 8 dots on the left side of the stage.\u003c/p\u003e\n\u003ch3 id="environment-variables"\u003eEnvironment Variables\u003c/h3\u003e\n\u003cp\u003eAdd or delete environment variables for the entire pipeline\u003c/p\u003e\n\u003ch3 id="parameters"\u003eParameters\u003c/h3\u003e\n\u003cp\u003eAdd or delete parameters for the entire pipeline\u003c/p\u003e\n\u003ch2 id="stage-configuration"\u003eStage Configuration\u003c/h2\u003e\n\u003ch3 id="stage-settings"\u003eStage Settings\u003c/h3\u003e\n\u003ctable\u003e\n\u003cthead\u003e\n\u003ctr\u003e\n\u003cth\u003e\u003c/th\u003e\n\u003cth\u003e\u003c/th\u003e\n\u003c/tr\u003e\n\u003c/thead\u003e\n\u003ctbody\u003e\n\u003ctr\u003e\n\u003ctd\u003eStage name\u003c/td\u003e\n\u003ctd\u003eThe name of the stage \u003cstrong\u003eREQUIRED\u003c/strong\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eTrigger on completion of previous stage\u003c/td\u003e\n\u003ctd\u003eIf on, automatically starts this stage when the previous one is done\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eAllow only on success of previous stage\u003c/td\u003e\n\u003ctd\u003eIf on, only automatically triggers on \u003ccode\u003esuccess\u003c/code\u003e of previous stage\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eFetch materials\u003c/td\u003e\n\u003ctd\u003ePerform a git-fetch (or other equivalent) before running jobs\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eNever cleanup artifacts\u003c/td\u003e\n\u003ctd\u003eIf \u003ccode\u003ePurge Artifacts\u003c/code\u003e is configured at the GoCD server level, this ensures the artifacts are not removed.\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eClean Working Directory\u003c/td\u003e\n\u003ctd\u003eRemoves working directory files \u003cem\u003ebefore\u003c/em\u003e the start of a new run\u003c/td\u003e\n\u003c/tr\u003e\n\u003c/tbody\u003e\n\u003c/table\u003e\n\u003ch3 id="jobs"\u003eJobs\u003c/h3\u003e\n\u003cp\u003eAdd or delete jobs in the stage\u003c/p\u003e\n\u003ch3 id="environment-variables-1"\u003eEnvironment Variables\u003c/h3\u003e\n\u003cp\u003eAdd or delete environment variables for just this stage\u003c/p\u003e\n\u003ch3 id="permissions"\u003ePermissions\u003c/h3\u003e\n\u003ctable\u003e\n\u003cthead\u003e\n\u003ctr\u003e\n\u003cth\u003e\u003c/th\u003e\n\u003cth\u003e\u003c/th\u003e\n\u003c/tr\u003e\n\u003c/thead\u003e\n\u003ctbody\u003e\n\u003ctr\u003e\n\u003ctd\u003eInherit from Pipeline Group\u003c/td\u003e\n\u003ctd\u003eInherits permissions from group at the Pipeline level (\u003ccode\u003edefault\u003c/code\u003e)\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eSpecify locally\u003c/td\u003e\n\u003ctd\u003eDefine permission locally (will override pipeline group permissions)\u003c/td\u003e\n\u003c/tr\u003e\n\u003c/tbody\u003e\n\u003c/table\u003e\n\u003ch2 id="job-configuration"\u003eJob Configuration\u003c/h2\u003e\n\u003ch3 id="job-settings"\u003eJob Settings\u003c/h3\u003e\n\u003cp\u003e\u003cstrong\u003eBasic Settings\u003c/strong\u003e\u003c/p\u003e\n\u003ctable\u003e\n\u003cthead\u003e\n\u003ctr\u003e\n\u003cth\u003e\u003c/th\u003e\n\u003cth\u003e\u003c/th\u003e\n\u003c/tr\u003e\n\u003c/thead\u003e\n\u003ctbody\u003e\n\u003ctr\u003e\n\u003ctd\u003eJob Name\u003c/td\u003e\n\u003ctd\u003eName of the job. \u003cstrong\u003eREQUIRED\u003c/strong\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eResources\u003c/td\u003e\n\u003ctd\u003eSpecify which Agent resources are needed to complete all tasks in the job\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eElastic Agent Profile ID\u003c/td\u003e\n\u003ctd\u003eSThe Elastic Agent Profile that the current job requires to run. Requires a configured Elastic Agent Profile.\u003c/td\u003e\n\u003c/tr\u003e\n\u003c/tbody\u003e\n\u003c/table\u003e\n\u003cp\u003e\u003cstrong\u003eJob Timeout\u003c/strong\u003e\u003c/p\u003e\n\u003ctable\u003e\n\u003cthead\u003e\n\u003ctr\u003e\n\u003cth\u003e\u003c/th\u003e\n\u003cth\u003e\u003c/th\u003e\n\u003c/tr\u003e\n\u003c/thead\u003e\n\u003ctbody\u003e\n\u003ctr\u003e\n\u003ctd\u003eNever\u003c/td\u003e\n\u003ctd\u003eWill run forever until succeeds or fails.\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eUse Default\u003c/td\u003e\n\u003ctd\u003eUse default timeout of 30 minutes\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eCancel after\u003c/td\u003e\n\u003ctd\u003eSpecify timeout in minutes of inactivity\u003c/td\u003e\n\u003c/tr\u003e\n\u003c/tbody\u003e\n\u003c/table\u003e\n\u003cp\u003e\u003cstrong\u003eRun Type\u003c/strong\u003e\u003c/p\u003e\n\u003ctable\u003e\n\u003cthead\u003e\n\u003ctr\u003e\n\u003cth\u003e\u003c/th\u003e\n\u003cth\u003e\u003c/th\u003e\n\u003c/tr\u003e\n\u003c/thead\u003e\n\u003ctbody\u003e\n\u003ctr\u003e\n\u003ctd\u003eRun on one instance\u003c/td\u003e\n\u003ctd\u003eWill only run on a single agent (\u003ccode\u003edefault\u003c/code\u003e)\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eRun on all agents\u003c/td\u003e\n\u003ctd\u003eWill run on all available agents with matching resources.\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eRun instances\u003c/td\u003e\n\u003ctd\u003eWill run the specified number of instances with available agents\u003c/td\u003e\n\u003c/tr\u003e\n\u003c/tbody\u003e\n\u003c/table\u003e\n\u003ch3 id="tasks"\u003eTasks\u003c/h3\u003e\n\u003cp\u003eAdd, edit, or delete tasks within the job.\u003c/p\u003e\n\u003ch3 id="artifacts"\u003eArtifacts\u003c/h3\u003e\n\u003cp\u003eAdd or remove artifacts.\u003c/p\u003e\n\u003cp\u003e\u003cstrong\u003eSource\u003c/strong\u003e\nThe \u003ccode\u003eSource\u003c/code\u003e is the file or relative path to upload. If the source is set to \u003ccode\u003ecoverage.xml\u003c/code\u003e it will look for that file in the job working directory. If the source is set to \u003ccode\u003eoutputs/*\u003c/code\u003e, it will grab all files in the \u003ccode\u003eoutputs\u003c/code\u003e directory.\u003c/p\u003e\n\u003cp\u003e\u003cstrong\u003eDestination\u003c/strong\u003e\nThe \u003ccode\u003eDestination\u003c/code\u003e directory is where it will put the artifacts on the GoCD server. If nothing is specified, it will put it in \u003ccode\u003etestoutput\u003c/code\u003e if it\u0026rsquo;s a test artifact or in the artifact root if it\u0026rsquo;s a built artifact.\u003c/p\u003e\n\u003ch3 id="environment-variables-2"\u003eEnvironment Variables\u003c/h3\u003e\n\u003cp\u003eAdd or delete environment variables for just this job\u003c/p\u003e\n\u003ch3 id="custom-tabs"\u003eCustom Tabs\u003c/h3\u003e\n\u003cp\u003eAdd or delete custom tabs for the job.\u003c/p\u003e\n\u003ctable\u003e\n\u003cthead\u003e\n\u003ctr\u003e\n\u003cth\u003e\u003c/th\u003e\n\u003cth\u003e\u003c/th\u003e\n\u003c/tr\u003e\n\u003c/thead\u003e\n\u003ctbody\u003e\n\u003ctr\u003e\n\u003ctd\u003eTab Name\u003c/td\u003e\n\u003ctd\u003eThe name for the tab\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003ePath\u003c/td\u003e\n\u003ctd\u003eThe path to the file in the artifacts you want to display in the Job Details page.\u003c/td\u003e\n\u003c/tr\u003e\n\u003c/tbody\u003e\n\u003c/table\u003e\n'}).add({id:6,href:"https://doks.netlify.app/docs/pipelines/agent/",title:"Configure a GoCD Agent",description:"Configure a Default GoCD Agent",content:'\u003ch3 id="setup"\u003eSetup\u003c/h3\u003e\n\u003cp\u003eLog in to the VM you would like to configure as a Default GoCD Agent. If you do not have one, you can \u003ca href="/docs/provisioning/provision/"\u003eProvision One â†’\u003c/a\u003e.\u003c/p\u003e\n\u003cdiv class="alert alert-warning d-flex" role="alert"\u003e\n  \u003cdiv class="flex-shrink-1 alert-icon"\u003eðŸ‘‰ \u003c/div\u003e\n  \n    \u003cdiv class="w-100"\u003eThis guide assumes you have \u003cb\u003esudo\u003c/b\u003e access. If you do not, you will not be able to configure the GoCD Agent. \u003c/div\u003e\n  \n\u003c/div\u003e\n\n\u003ch3 id="configure"\u003eConfigure\u003c/h3\u003e\n\u003cp\u003eThere are two ways you can configure the vm:\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eYou can download the script from inside the vm via \u003ccode\u003ecurl\u003c/code\u003e:\u003c/li\u003e\n\u003c/ol\u003e\n\u003cpre\u003e\u003ccode class="language-bash"\u003ecurl https://raw.githubusercontent.com/Agile-Defense/scripts/master/GoCD/configure_default_agent.sh -O configure_default_agent.sh\nchmod +x configure_default_agent.sh\n\u003c/code\u003e\u003c/pre\u003e\n\u003cp\u003eor via \u003ccode\u003ewget\u003c/code\u003e:\u003c/p\u003e\n\u003cpre\u003e\u003ccode class="language-bash"\u003ewget https://raw.githubusercontent.com/Agile-Defense/scripts/master/GoCD/configure_default_agent.sh\nchmod +x configure_default_agent.sh\n\u003c/code\u003e\u003c/pre\u003e\n\u003cp\u003eThen run it with:\u003c/p\u003e\n\u003cpre\u003e\u003ccode class="language-bash"\u003e./configure_default_agent.sh\n\u003c/code\u003e\u003c/pre\u003e\n\u003cp\u003eIt will automatically clean up after itself too.\u003c/p\u003e\n\u003cbr/\u003e\n\u003col start="2"\u003e\n\u003cli\u003eIf you cannot download it for any reason, just copy and paste this into your terminal:\u003c/li\u003e\n\u003c/ol\u003e\n\u003cpre\u003e\u003ccode class="language-bash"\u003e#!/bin/bash\n\n# Add go-agent to sources list for apt\necho \u0026quot;deb https://download.gocd.org /\u0026quot; | sudo tee /etc/apt/sources.list.d/gocd.list\n\n# Add go-agent key apt-key\ncurl https://download.gocd.org/GOCD-GPG-KEY.asc | sudo apt-key add -\n\n# Run update to pull latest go-agent into apt\nsudo apt-get update\n\n# Install go-agent\nsudo apt-get install go-agent\n\n# Configure go-sever for agent\nsudo sed -i -e \'s/localhost:8153/gocd.agiledefense.lab/\' /usr/share/go-agent/wrapper-config/wrapper-properties.conf\n\n# Start and enable go-agent\nsudo systemctl start go-agent\nsudo systemctl enable go-agent\n\n# Download sonar-scanner zip file\nwget -O sonar-scanner.zip https://binaries.sonarsource.com/Distribution/sonar-scanner-cli/sonar-scanner-cli-4.6.2.2472-linux.zip\n\n# Install unzip to unzip zipfile (not installed by default)\nsudo apt-get -y install unzip\n\n# Unzip sonar-scanner files\nsudo unzip sonar-scanner.zip -d /etc\n\n# Rename directory for better management and linking\nsudo mv /etc/sonar-scanner-* /etc/sonar\n\n# Configure default sonar server\nsudo sed -i -e \'s/#sonar.host.url=http:\\/\\/localhost:9000/sonar.host.url=http:\\/\\/sonar.agiledefense.lab/\' /etc/sonar/conf/sonar-scanner.properties\n\n# Create symlinks to binaries so they\'re availabel on system PATH\nsudo ln -s /etc/sonar/bin/sonar-scanner /usr/bin/sonar-scanner\nsudo ln -s /etc/sonar/bin/sonar-scanner-debug /usr/bin/sonar-scanner-debug\n\n# Install pip3 apt package\nsudo apt install -y python3-pip\n\n# Pip install dependency-check (use sudo so it installs bin file on PATH)\nsudo pip3 install dependency-check\n\n# Install Java 11 for dependency-check\nsudo apt install -y openjdk-11-jdk-headless\n\n# Generate SSH key for go user\nsudo su - go -c \'ssh-keygen -b 2048 -t rsa -f /var/go/.ssh/id_rsa -q -N \u0026quot;\u0026quot;\'\n\n\n# Register Key with GitHub\nregistration_status=$(curl -G -X POST -v --data-urlencode \u0026quot;key=$(sudo cat /var/go/.ssh/id_rsa.pub)\u0026quot; --data-urlencode \u0026quot;host=$(hostname)\u0026quot; \u0026quot;http://gocd.agiledefense.lab:6523/register-ssh-key\u0026quot;)\nif [[ \u0026quot;$registration_status\u0026quot; == *\u0026quot;successful\u0026quot;* ]]\nthen\n	echo \u0026quot;Sucessfully registered ssh key with GoCD-Agent github account\u0026quot;\nelse\n	echo \u0026quot;Failed to register: $registration_status\u0026quot; \u0026amp;\u0026amp; exit 1\nfi\n\n# Perform initial pull to add ssh-key to known hosts\nsudo su - go -c \'if [ ! -n \u0026quot;$(grep \u0026quot;^github.com \u0026quot; ~/.ssh/known_hosts)\u0026quot; ]; then ssh-keyscan github.com \u0026gt;\u0026gt; ~/.ssh/known_hosts 2\u0026gt;/dev/null; fi; git clone git@github.com:Agile-Defense/GoAgentPullTest.git\'\nsudo rm -rf /var/go/GoAgentPullTest\nsudo rm -rf sonar-scanner.zip\nsudo rm -rf configure_default_agent.sh\n\u003c/code\u003e\u003c/pre\u003e\n\u003ch3 id="go-agent-only"\u003eGo-Agent ONLY\u003c/h3\u003e\n\u003cp\u003eIf you just want to install the \u003ca href="https://docs.gocd.org/current/installation/installing_go_agent.html"\u003ego-agent\u003c/a\u003e, you can use this snippet of the script to only install that dependency:\u003c/p\u003e\n\u003cpre\u003e\u003ccode class="language-bash"\u003e# Add go-agent to sources list for apt\necho \u0026quot;deb https://download.gocd.org /\u0026quot; | sudo tee /etc/apt/sources.list.d/gocd.list\n\n# Add go-agent key apt-key\ncurl https://download.gocd.org/GOCD-GPG-KEY.asc | sudo apt-key add -\n\n# Run update to pull latest go-agent into apt\nsudo apt-get update\n\n# Install go-agent\nsudo apt-get install go-agent\n\n# Configure go-sever for agent\nsudo sed -i -e \'s/localhost:8153/gocd.agiledefense.lab/\' /usr/share/go-agent/wrapper-config/wrapper-properties.conf\n\n# Start and enable go-agent\nsudo systemctl start go-agent\nsudo systemctl enable go-agent\n\n# Generate SSH key for go user\nsudo su - go -c \'ssh-keygen -b 2048 -t rsa -f /var/go/.ssh/id_rsa -q -N \u0026quot;\u0026quot;\'\n\n\n# Register Key with GitHub\nregistration_status=$(curl -G -X POST -v --data-urlencode \u0026quot;key=$(sudo cat /var/go/.ssh/id_rsa.pub)\u0026quot; --data-urlencode \u0026quot;host=$(hostname)\u0026quot; \u0026quot;http://gocd.agiledefense.lab:6523/register-ssh-key\u0026quot;)\nif [[ \u0026quot;$registration_status\u0026quot; == *\u0026quot;successful\u0026quot;* ]]\nthen\n	echo \u0026quot;Sucessfully registered ssh key with GoCD-Agent github account\u0026quot;\nelse\n	echo \u0026quot;Failed to register: $registration_status\u0026quot; \u0026amp;\u0026amp; exit 1\nfi\n\n# Perform initial pull to add ssh-key to known hosts\nsudo su - go -c \'if [ ! -n \u0026quot;$(grep \u0026quot;^github.com \u0026quot; ~/.ssh/known_hosts)\u0026quot; ]; then ssh-keyscan github.com \u0026gt;\u0026gt; ~/.ssh/known_hosts 2\u0026gt;/dev/null; fi; git clone git@github.com:Agile-Defense/GoAgentPullTest.git\'\nsudo rm -rf /var/go/GoAgentPullTest\n\u003c/code\u003e\u003c/pre\u003e\n\u003ch3 id="sonar-scanner-only"\u003eSonar-Scanner ONLY\u003c/h3\u003e\n\u003cp\u003eIf you just want to install the \u003ca href="https://docs.sonarqube.org/latest/analysis/scan/sonarscanner/"\u003esonar-scanner\u003c/a\u003e, you can use this snippets to install it with \u003ccode\u003edependency-check\u003c/code\u003e:\u003c/p\u003e\n\u003cpre\u003e\u003ccode class="language-bash"\u003e# Download sonar-scanner zip file\nwget -O sonar-scanner.zip https://binaries.sonarsource.com/Distribution/sonar-scanner-cli/sonar-scanner-cli-4.6.2.2472-linux.zip\n\n# Install unzip to unzip zipfile (not installed by default)\nsudo apt-get -y install unzip\n\n# Unzip sonar-scanner files\nsudo unzip sonar-scanner.zip -d /etc\n\n# Rename directory for better management and linking\nsudo mv /etc/sonar-scanner-* /etc/sonar\n\n# Configure default sonar server\nsudo sed -i -e \'s/#sonar.host.url=http:\\/\\/localhost:9000/sonar.host.url=http:\\/\\/sonar.agiledefense.lab/\' /etc/sonar/conf/sonar-scanner.properties\n\n# Create symlinks to binaries so they\'re availabel on system PATH\nsudo ln -s /etc/sonar/bin/sonar-scanner /usr/bin/sonar-scanner\nsudo ln -s /etc/sonar/bin/sonar-scanner-debug /usr/bin/sonar-scanner-debug\n\n# Install pip3 apt package\nsudo apt install -y python3-pip\n\n# Pip install dependency-check (use sudo so it installs bin file on PATH)\nsudo pip3 install dependency-check\n\n# Install Java 11 for dependency-check\nsudo apt install -y openjdk-11-jdk-headless\n\u003c/code\u003e\u003c/pre\u003e\n\u003cp\u003eand \u003cstrong\u003ewithout\u003c/strong\u003e \u003ccode\u003edepenency-check\u003c/code\u003e:\u003c/p\u003e\n\u003cpre\u003e\u003ccode class="language-bash"\u003e# Download sonar-scanner zip file\nwget -O sonar-scanner.zip https://binaries.sonarsource.com/Distribution/sonar-scanner-cli/sonar-scanner-cli-4.6.2.2472-linux.zip\n\n# Install unzip to unzip zipfile (not installed by default)\nsudo apt-get -y install unzip\n\n# Unzip sonar-scanner files\nsudo unzip sonar-scanner.zip -d /etc\n\n# Rename directory for better management and linking\nsudo mv /etc/sonar-scanner-* /etc/sonar\n\n# Configure default sonar server\nsudo sed -i -e \'s/#sonar.host.url=http:\\/\\/localhost:9000/sonar.host.url=http:\\/\\/sonar.agiledefense.lab/\' /etc/sonar/conf/sonar-scanner.properties\n\n# Create symlinks to binaries so they\'re availabel on system PATH\nsudo ln -s /etc/sonar/bin/sonar-scanner /usr/bin/sonar-scanner\nsudo ln -s /etc/sonar/bin/sonar-scanner-debug /usr/bin/sonar-scanner-debug\n\u003c/code\u003e\u003c/pre\u003e\n\u003ch3 id="enabling-environments-and-resources"\u003eEnabling, Environments, and Resources\u003c/h3\u003e\n\u003cp\u003eAfter the script finishes and cleans up, you need to navigate to \u003ca href="http://gocd.agiledefense.lab/go/agents"\u003eGoCD Agents Tab\u003c/a\u003e and check the box next to the Agent you just configured. You will see it is not enabled yet. Click \u003ccode\u003eEnable\u003c/code\u003e to enable it.\u003c/p\u003e\n\u003cp\u003eAfter it\u0026rsquo;s been enabled, add it to the requisite environments by checking the box next to it again, clicking the \u003ccode\u003eEnvironments\u003c/code\u003e drop down menu, selecting the environments, and clicking \u003cstrong\u003eApply\u003c/strong\u003e.\u003c/p\u003e\n\u003cp\u003eLastly, check the box again and click the \u003ccode\u003eResources\u003c/code\u003e drop down menu. From here, select all of the resources you\u0026rsquo;ve installed. If you just ran the script and have not installed any other resources, select \u003ccode\u003ePython3\u003c/code\u003e, \u003ccode\u003eGitHub\u003c/code\u003e, \u003ccode\u003edependency-check\u003c/code\u003e, and \u003ccode\u003esonar-scanner\u003c/code\u003e. If you used a \u003ca href="/docs/provisioning/net-booting/"\u003enet-booted\u003c/a\u003e VM, you can also select \u003ccode\u003eLinux-Ubuntu\u003c/code\u003e. Then click \u003cstrong\u003eApply\u003c/strong\u003e.\u003c/p\u003e\n\u003ch3 id="congratulations"\u003eCongratulations!\u003c/h3\u003e\n\u003cp\u003eYou\u0026rsquo;ve successfully configured a GoCD Agent!\u003c/p\u003e\n'}).add({id:7,href:"https://doks.netlify.app/docs/sonarqube/project/",title:"Setup SonarQube Project",description:"Setup project for static code and dependency checking",content:'\u003ch3 id="setup"\u003eSetup\u003c/h3\u003e\n\u003cp\u003eThis guide assumes you have a GoCd Pipeline already setup. If not, \u003ca href="/docs/pipelines/create/"\u003eSetup a Pipeline\u003c/a\u003e.\u003c/p\u003e\n\u003cp\u003eLog in to \u003ca href="http://sonar.agiledefense.lab"\u003eSonarQube\u003c/a\u003e with your lab credentials.\u003c/p\u003e\n\u003ch3 id="add-project"\u003eAdd Project\u003c/h3\u003e\n\u003cp\u003eClick the \u003cstrong\u003eAdd Project\u003c/strong\u003e drop down menu in the upper right-hand corner under your username and select \u003ccode\u003eManually\u003c/code\u003e.\u003c/p\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/sonar_1.png" alt="img"\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003cp\u003eOn the next menu, enter in the \u003ccode\u003eProject Key\u003c/code\u003e and \u003ccode\u003eDisplay Name\u003c/code\u003e. They can be the same or different, but the \u003ccode\u003eProject Key\u003c/code\u003e is how Sonar indexes your project. Then, click \u003cstrong\u003eSet Up\u003c/strong\u003e.\u003c/p\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/sonar_2.png" alt="img"\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003ch3 id="generate-token"\u003eGenerate token\u003c/h3\u003e\n\u003cp\u003eOn the next page after clicking \u003cstrong\u003eSet Up\u003c/strong\u003e, it will ask if you want to \u003ccode\u003eGenerate a token\u003c/code\u003e or \u003ccode\u003eUse an existing token\u003c/code\u003e. It is \u003cstrong\u003eHEAVILY\u003c/strong\u003e encouraged that you generate a new token for your project.\u003c/p\u003e\n\u003cp\u003eTo do that, highlight \u003ccode\u003eGenerate a token\u003c/code\u003e, enter a name for the token, we\u0026rsquo;ll use \u003ccode\u003etest_token\u003c/code\u003e, and then click \u003cstrong\u003eGenerate\u003c/strong\u003e.\u003c/p\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/sonar_3.png" alt="img"\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003cp\u003eAfter that, your token will appear. \u003cstrong\u003eBe sure to copy your token!!\u003c/strong\u003e. This is the only time it is displayed. If you lose it before adding it into the \u003ccode\u003eSonar-Scan\u003c/code\u003e stage of the pipeline, you\u0026rsquo;ll need to revoke and regenerate a new one.\u003c/p\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/sonar_4.png" alt="img"\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003ch3 id="create-sonar-scan-stage"\u003eCreate Sonar-Scan Stage\u003c/h3\u003e\n\u003cp\u003eLog into \u003ca href=""\u003eGoCD\u003c/a\u003e with your lab credentials, and click on the wheel icon in the top right corner of your pipeline.\u003c/p\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/sonar_5.png" alt="img"\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003cp\u003eThen go to the \u003cstrong\u003eStages\u003c/strong\u003e tab in your pipeline config and click \u003cstrong\u003eAdd new stage\u003c/strong\u003e.\u003c/p\u003e\n\u003cp\u003eName it \u003ccode\u003eSonar-Scan\u003c/code\u003e or something to that effect and name the job something like \u003ccode\u003esonar-scanner\u003c/code\u003e.\u003c/p\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/sonar_6.png" width="725" /\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003cp\u003eFor the \u003cstrong\u003eCommand\u003c/strong\u003e enter \u003ccode\u003esonar-scanner\u003c/code\u003e, and the \u003cstrong\u003earguments\u003c/strong\u003e are \u003ccode\u003e-Dlogin={TOKEN}\u003c/code\u003e where \u003ccode\u003e{TOKEN}\u003c/code\u003e is the token you copied from the \u003cstrong\u003eGenerate token\u003c/strong\u003e step. Now click \u003cstrong\u003eSave\u003c/strong\u003e.\u003c/p\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/sonar_7.png" width="725" /\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003ch3 id="optional-dependency-checking"\u003eOptional: Dependency Checking\u003c/h3\u003e\n\u003cp\u003eAlthough optional, it is highly encouraged to set up dependency checking for your project. To do that, go to your \u003ccode\u003eSonar-Scan\u003c/code\u003e stage of your pipeline and enter its \u003ccode\u003esonar-scanner\u003c/code\u003e Task tab. Then click \u003cstrong\u003eAdd Task\u003c/strong\u003e for type \u003ccode\u003eCustom Command\u003c/code\u003e.\u003c/p\u003e\n\u003cp\u003eFor the command enter \u003ccode\u003edependency-check\u003c/code\u003e, and the \u003cstrong\u003earguments\u003c/strong\u003e are \u003ccode\u003e--disableAssembly --enableExperimental -s . --project {PROJECT} -f HTML\u003c/code\u003e where \u003ccode\u003e{PROJECT}\u003c/code\u003e is the project name we gave the SonarQube project in the \u003cstrong\u003eAdd Project\u003c/strong\u003e step.\u003c/p\u003e\n\u003cdiv class="alert alert-warning d-flex" role="alert"\u003e\n  \u003cdiv class="flex-shrink-1 alert-icon"\u003eðŸ‘‰ \u003c/div\u003e\n  \n    \u003cdiv class="w-100"\u003e\u003cb\u003eNOTE\u003c/b\u003e: Ensure that each argument is on its own line with no leading or trailing spaces. \u003c/div\u003e\n  \n\u003c/div\u003e\n\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/sonar_8.png" width="725" /\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003cp\u003eNow make the \u003ccode\u003edependency-check\u003c/code\u003e task first so it can generate the files that are needed when running \u003ccode\u003esonar-scanner\u003c/code\u003e. Just drag it by the dots on the left, so it\u0026rsquo;s above the top task. Be sure to click \u003cstrong\u003eSave\u003c/strong\u003e.\u003c/p\u003e\n\u003cp\u003e\u003cimg src="https://raw.githubusercontent.com/Agile-Defense/agile-defense.github.io/main/assets/images/sonar_9.png" width="725" /\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003ch3 id="restart-pipeline"\u003eRestart Pipeline\u003c/h3\u003e\n\u003cp\u003eNow that your Stages, jobs, and tasks are added, you can manually execute your pipeline from the dashboard, or waiting for changes to your code to automatically start it.\u003c/p\u003e\n\u003ch3 id="congratulations"\u003eCongratulations!\u003c/h3\u003e\n\u003cp\u003eYour pipeline has not increased its level of operational and engineering excellence by incorporating static code vulnerability analysis and dependency scanning.\u003c/p\u003e\n'}).add({id:8,href:"https://doks.netlify.app/docs/sonarqube/",title:"SonarQube",description:"SonarQube Security",content:""}).add({id:9,href:"https://doks.netlify.app/docs/help/how-to-update/",title:"How to Update",description:"Regularly update the installed npm packages to keep your Doks website stable, usable, and secure.",content:'\u003cdiv class="alert alert-warning d-flex" role="alert"\u003e\n  \u003cdiv class="flex-shrink-1 alert-icon"\u003eðŸ’¡ \u003c/div\u003e\n  \n    \u003cdiv class="w-100"\u003eLearn more about \u003ca href="https://docs.npmjs.com/about-semantic-versioning"\u003esemantic versioning\u003c/a\u003e and \u003ca href="https://docs.npmjs.com/cli/v6/using-npm/semver#advanced-range-syntax"\u003eadvanced range syntax\u003c/a\u003e. \u003c/div\u003e\n  \n\u003c/div\u003e\n\n\u003ch2 id="check-for-outdated-packages"\u003eCheck for outdated packages\u003c/h2\u003e\n\u003cp\u003eThe \u003ca href="https://docs.npmjs.com/cli/v7/commands/npm-outdated"\u003e\u003ccode\u003enpm outdated\u003c/code\u003e\u003c/a\u003e command will check the registry to see if any (or, specific) installed packages are currently outdated:\u003c/p\u003e\n\u003cpre\u003e\u003ccode class="language-bash"\u003enpm outdated [[\u0026lt;@scope\u0026gt;/]\u0026lt;pkg\u0026gt; ...]\n\u003c/code\u003e\u003c/pre\u003e\n\u003ch2 id="update-packages"\u003eUpdate packages\u003c/h2\u003e\n\u003cp\u003eThe \u003ca href="https://docs.npmjs.com/cli/v7/commands/npm-update"\u003e\u003ccode\u003enpm update\u003c/code\u003e\u003c/a\u003e command will update all the packages listed to the latest version (specified by the tag config), respecting semver:\u003c/p\u003e\n\u003cpre\u003e\u003ccode class="language-bash"\u003enpm update [\u0026lt;pkg\u0026gt;...]\n\u003c/code\u003e\u003c/pre\u003e\n'}).add({id:10,href:"https://doks.netlify.app/docs/help/troubleshooting/",title:"Troubleshooting",description:"Solutions to common problems.",content:'\u003ch2 id="problems-updating-npm-packages"\u003eProblems updating npm packages\u003c/h2\u003e\n\u003cp\u003eDelete the \u003ccode\u003e./node_modules\u003c/code\u003e folder, and run again:\u003c/p\u003e\n\u003cpre\u003e\u003ccode class="language-bash"\u003enpm install\n\u003c/code\u003e\u003c/pre\u003e\n\u003ch2 id="problems-with-cache"\u003eProblems with cache\u003c/h2\u003e\n\u003cp\u003eDelete the temporary directories:\u003c/p\u003e\n\u003cpre\u003e\u003ccode class="language-bash"\u003enpm run clean\n\u003c/code\u003e\u003c/pre\u003e\n'}).add({id:11,href:"https://doks.netlify.app/docs/help/faq/",title:"FAQ",description:"Answers to frequently asked questions.",content:'\u003ch2 id="hyas"\u003eHyas?\u003c/h2\u003e\n\u003cp\u003eDoks is a \u003ca href="https://gethyas.com/themes/"\u003eHyas theme\u003c/a\u003e build by the creator of Hyas.\u003c/p\u003e\n\u003ch2 id="footer-notice"\u003eFooter notice?\u003c/h2\u003e\n\u003cp\u003ePlease keep it in place.\u003c/p\u003e\n\u003ch2 id="keyboard-shortcuts-for-search"\u003eKeyboard shortcuts for search?\u003c/h2\u003e\n\u003cul\u003e\n\u003cli\u003efocus: \u003ccode\u003eCtrl + /\u003c/code\u003e\u003c/li\u003e\n\u003cli\u003eselect: \u003ccode\u003eâ†“\u003c/code\u003e and \u003ccode\u003eâ†‘\u003c/code\u003e\u003c/li\u003e\n\u003cli\u003eopen: \u003ccode\u003eEnter\u003c/code\u003e\u003c/li\u003e\n\u003cli\u003eclose: \u003ccode\u003eEsc\u003c/code\u003e\u003c/li\u003e\n\u003c/ul\u003e\n\u003ch2 id="other-documentation"\u003eOther documentation?\u003c/h2\u003e\n\u003cul\u003e\n\u003cli\u003e\u003ca href="https://docs.netlify.com/"\u003eNetlify\u003c/a\u003e\u003c/li\u003e\n\u003cli\u003e\u003ca href="https://gohugo.io/documentation/"\u003eHugo\u003c/a\u003e\u003c/li\u003e\n\u003c/ul\u003e\n\u003ch2 id="can-i-get-support"\u003eCan I get support?\u003c/h2\u003e\n\u003cp\u003eCreate a topic:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003e\u003ca href="https://community.netlify.com/"\u003eNetlify Community\u003c/a\u003e\u003c/li\u003e\n\u003cli\u003e\u003ca href="https://discourse.gohugo.io/"\u003eHugo Forums\u003c/a\u003e\u003c/li\u003e\n\u003cli\u003e\u003ca href="https://github.com/h-enk/doks/discussions"\u003eDoks Discussions\u003c/a\u003e\u003c/li\u003e\n\u003c/ul\u003e\n\u003ch2 id="contact-the-creator"\u003eContact the creator?\u003c/h2\u003e\n\u003cp\u003eSend \u003ccode\u003eh-enk\u003c/code\u003e a message:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003e\u003ca href="https://community.netlify.com/"\u003eNetlify Community\u003c/a\u003e\u003c/li\u003e\n\u003cli\u003e\u003ca href="https://discourse.gohugo.io/"\u003eHugo Forums\u003c/a\u003e\u003c/li\u003e\n\u003cli\u003e\u003ca href="https://github.com/h-enk/doks/discussions"\u003eDoks Discussions\u003c/a\u003e\u003c/li\u003e\n\u003c/ul\u003e\n'}).add({id:12,href:"https://doks.netlify.app/docs/help/",title:"Help",description:"Help Doks.",content:""}).add({id:13,href:"https://doks.netlify.app/docs/",title:"Docs",description:"Agile Defense Docs",content:'\u003ch2 id="servers"\u003eServers\u003c/h2\u003e\n\u003cp\u003eTo make vm\u0026rsquo;s in the lab, see \u003ca href="/docs/provisioning/provision/"\u003eProvisioning â†’\u003c/a\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003ch2 id="pipelines"\u003ePipelines\u003c/h2\u003e\n\u003cp\u003eTo automate with pipelines, go to \u003ca href="/docs/pipelines/"\u003ePipelines â†’\u003c/a\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003ch2 id="sonarqube"\u003eSonarQube\u003c/h2\u003e\n\u003cp\u003eTo secure your code with SonarQube, go visit \u003ca href="/docs/sonarqube/"\u003eSonarQube â†’\u003c/a\u003e\u003c/p\u003e\n\u003cbr/\u003e\n\u003ch1 id="list-of-docs-pages"\u003eList of Docs Pages\u003c/h1\u003e\n'}),search.addEventListener('input',b,!0),suggestions.addEventListener('click',c,!0);function b(){var d,e;const c=5;d=this.value,e=a.search(d,{limit:c,enrich:!0}),suggestions.classList.remove('d-none'),suggestions.innerHTML="";const b={};e.forEach(a=>{a.result.forEach(a=>{b[a.doc.href]=a.doc})});for(const d in b){const e=b[d],a=document.createElement('div');if(a.innerHTML='<a href><span></span><span></span></a>',a.querySelector('a').href=d,a.querySelector('span:first-child').textContent=e.title,a.querySelector('span:nth-child(2)').textContent=e.description,suggestions.appendChild(a),suggestions.childElementCount==c)break}}function c(){while(suggestions.lastChild)suggestions.removeChild(suggestions.lastChild);return!1}})()